css:
@-moz-document domain("gamestar.de") {
html {
    background: #000 !important
}

body:not(:fullscreen) {
    background: #fff !important;
    filter: invert(93%) hue-rotate(180deg) !important
}

iframe:not(:fullscreen),
img:not(:fullscreen),
svg:not(:fullscreen),
div#header-brand,
div#header-navi,
li.nav-item.dropdown,
a.nav-link,
a.js-loadvideo,
span.video-container:not(:fullscreen),
div.jw-icon:not(.jw-text),
footer#footer {
    filter: invert(1) hue-rotate(180deg) !important
}

div#header-trending {
    z-index:-1
}
}
